import { Card,CardHeader,CardActionArea,CardMedia,CardContent, Typography,CardActions,makeStyles, Button, Avatar,IconButton } from '@material-ui/core';
import { MoreVert } from '@material-ui/icons';


const useStyles = makeStyles((theme) => ({
  media:{
    height: 250,
    marginTop: 5,
    [theme.breakpoints.down("sm")]:{
      height: 150,
    },
  },
  card:{
    marginBottom: theme.spacing(3),
  },
  tile:{
    height: theme.spacing(40),
    display: "flex",
    flexDirection: "column",
    margin: 5,

  },
  name:{
    fontSize: 16,
    fontWeight: 500,
    color: "#555",
  },
}));
export default function Post() {
  const classes = useStyles();

  return (
    <Card className={classes.card}>
      <CardHeader 
          avatar={
            <Avatar />
          }
          action={
            <IconButton aria-label="settings">
            <MoreVert />
            </IconButton>
          }
          title={
            <Typography> Manohisoa</Typography>
          }
          subheader="1 minute ago"
      />
      <CardActionArea>
        <CardMedia className={classes.media} image="https://material-ui.com/static/images/cards/paella.jpg" />
        <CardContent>
          <Typography gutterBottom variant="h5">My first post</Typography>
          <Typography variant="body">Lorem ipsum</Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary">
          Share
        </Button>
        <Button size="small" color="primary">
          Learn more
        </Button>
      </CardActions>
    </Card>
  );
}
